import Home from './Home';
import {
  CDBSidebar,
  CDBSidebarHeader,
  CDBSidebarMenuItem,
  CDBSidebarContent,
  CDBSidebarMenu,
  // CDBSidebarSubMenu,
  // CDBSidebarFooter,
  // CDBBadge,
  // CDBContainer,
} from 'cdbreact';
import { useNavigate } from 'react-router-dom';
import { NavLink } from 'react-bootstrap';
// import Home from './Home';

const Sidebar = () => {
  const navigate =useNavigate();
  return (
      <CDBSidebar textColor="#333" backgroundColor="#f0f0f0">
        <CDBSideHeader prefix={<i className="fa fa-bars" />}>
          <div className="container" style={{ display: 'flex', alignItems: 'center' }}>
            <img
              src={'https://seeklogo.com/images/B/butterfly-logo-0A00378822-seeklogo.com.png'}
              alt=""
              style={{ width: '30px' }}
            />
            <h6 className="ml-2">BABYCARE â„¢</h6>
          </div>
        </CDBSideHeader>
        <CDBSidebarContent>
          <CDBSidebarMenu>
            <CDBSidebarMenuItem icon="th-large">Dashboard</CDBSidebarMenuItem>
            <CDBSidebarMenuItem icon="home"><NavLink href="/home"/>Home</CDBSidebarMenuItem>
            <CDBSidebarMenuItem icon="calculator">calculator</CDBSidebarMenuItem>
            <CDBSidebarMenuItem icon="clipboard-list" iconType="solid">
              Details
            </CDBSidebarMenuItem>
          </CDBSidebarMenu>
        </CDBSidebarContent>
      </CDBSidebar>
  )
};

export default Sidebar;
